import React, { Component } from 'react';

export default class InputReadOnly extends Component {
  render() {
    const {
      baseINSS,
      discountINSS,
      baseIRPF,
      discountIRPF,
      netSalary,
    } = this.props;

    return (
      <div>
        <div>
          <span>Base INSS:</span>
          <input type="text" value={baseINSS} readOnly></input>
        </div>
        <div>
          <span>Desconto INSS:</span>
          <input type="text" value={discountINSS} readOnly></input>
        </div>
        <div>
          <span>Base IRPF:</span>
          <input type="text" value={baseIRPF} readOnly></input>
        </div>
        <div>
          <span>Desconto INSS:</span>
          <input type="text" value={discountIRPF} readOnly></input>
        </div>
        <div>
          <span>Salário Líquido:</span>
          <input type="text" value={netSalary} readOnly></input>
        </div>
      </div>
    );
  }
}
